import Painter from './class/Painter.js'
import Palette from './class/Palette.js'
const painter = new Painter('#mainCanvas')
const palette = new Palette('#palette', 510, 510, 20, 2)
const ID = id => document.getElementById(id)
const SELECT = selected => document.querySelector(selected)
const ACT = (dom, act) => {
  const LIST = dom.classList
  switch (act) {
    case 'add':
      LIST.add('active')
      break
    case 'remove':
      LIST.remove('active')
      break
    case 'toggle':
      LIST.toggle('active')
      break
  }
}
let rect = { x: '', y: '' }
let circle = { cx: '', cy: '', r: '' }
let setBrush = color => {
  ID('brush').style.fill = color
  SELECT('.rect').style.stroke = color
  SELECT('.circle').style.stroke = color
  color === 'white' || color === 'rgba(0,0,0,0)'
    ? (ID('brush').style.stroke = 'black')
    : (ID('brush').style.stroke = color)
}
let setShape = color => {
  SELECT('.rect').style.fill = color
  SELECT('.circle').style.fill = color
}
let setChecked = (posX, active, num = 1) => {
  let id = 'checked' + num
  let posY = num === 1 ? '48%' : num === 2 ? '62%' : '24%'
  ID(id).style.transform = `translate(${posX},${posY})` + `rotate(45deg)`
  ACT(ID(id), active)
  setTimeout(_ => active === 'toggle' && ACT(ID(id), 'add'), 0)
}
function slide() {
  event.stopPropagation()
  ACT(this.parentNode, 'toggle')
  ACT(this, 'toggle')
}
window.addEventListener('contextmenu', _ => (event.returnValue = false))
window.addEventListener(
  'load',
  _ => (SELECT('#size').textContent = painter.getStrokeWidth)
)
window.addEventListener(
  'beforeunload',
  _ => (event.returnValue = 'Did you save it?')
)

SELECT('.slide-up').addEventListener('click', slide)
SELECT('.slide-down').addEventListener('click', slide)

ID('toolbar').addEventListener('click', function(e) {
  e.stopPropagation()

  let group = e.target.parentNode.id
  switch (group) {
    case 'save':
      painter.save()
      break
    case 'load':
      painter.load()
    case 'clean':
      painter.clean()
      painter.reset()
      ACT(ID('undo'), 'remove')
      break

    case 'undo':
      painter.undo()
      painter.getDoneStep || ACT(ID('undo'), 'remove')
      painter.getDoneStep && ACT(ID('redo'), 'add')
      break

    case 'redo':
      painter.redo()
      painter.getStack.length === painter.getDoneStep
        ? ACT(ID('redo'), 'remove')
        : ACT(ID('undo'), 'add')
      break
  }
})

let sizeAttX = ID('size').getAttribute('x')
let sizePos = 1 + parseInt(sizeAttX.slice(0, sizeAttX.length - 1))

ID('painting').addEventListener('click', function(e) {
  let group = e.target.parentNode.classList.value
  let color = ''
  let move = 0
  let tool = e.target.id
  let isTheseTool = ['brush', 'rect', 'circle', 'eraser'].some(e => e === tool)

  switch (group) {
    case 'draw':
      let attrX = e.target.getAttribute('x')
      let attXval = attrX && +attrX.split('%')[0] + 2.5 + '%'
      painter.setTool = tool
      tool === 'paletteBtn' && palette.toggle() && SELECT('#paletteBtn')
      isTheseTool && palette.remove()
      move = attXval || e.target.getAttribute('cx')

      setChecked(move, 'toggle', 3)
      break

    case 'form':
      e.target.id === 'increase' && (painter.setStrokeWidth = 1)
      e.target.id === 'decrease' && (painter.setStrokeWidth = -1)

      let strLen = (painter.getStrokeWidth + '').length
      ID('size').textContent = painter.getStrokeWidth
      ID('size').setAttribute('x', sizePos - strLen + '%')
      break

    case 'color-block':
      painter.tool === 'straw' && (painter.tool = 'brush')
      palette.remove()
      color = e.target.getAttribute('fill')
      painter.setStrokeColor = color
      move = e.target.getAttribute('cx')
      setChecked(move, 'toggle')
      setBrush(color)
      break
  }
})
ID('painting').addEventListener('mousedown', function(e) {
  let group = e.target.parentNode.classList.value
  let color = ''
  let move = 0
  if (group === 'color-block' && e.button === 2) {
    palette.remove()
    move = e.target.getAttribute('cx')
    color = e.target.getAttribute('fill')
    painter.setFillColor = color
    setShape(color)
    setChecked(move, 'toggle', 2)
  }
})

painter.area.addEventListener('mousedown', function(e) {
  if (painter.tool === 'paletteBtn') {
    palette.remove()
    painter.setTool = 'brush'
  }

  painter.toWork = true
  if (painter.getTool === 'brush') {
    painter.ctx.beginPath()
  } else if (painter.getTool === 'rect') {
    rect.x = e.offsetX
    rect.y = e.offsetY
  } else if (painter.getTool === 'circle') {
    circle.cx = e.offsetX
    circle.cy = e.offsetY
  }
})
painter.area.addEventListener('mousemove', function(e) {
  if (painter.toWork) {
    if (painter.tool === 'brush') {
      painter.brush(e)
    } else if (painter.tool === 'eraser') {
      painter.earser(e)
    } else if (painter.tool === 'rect') {
      painter.drawingRect(e, rect)
    } else if (painter.tool === 'circle') {
      painter.drawCircle(e, circle)
    }
  }
})
painter.area.addEventListener('mouseup', function(e) {
  let isTheseTool = ['brush', 'rect', 'circle', 'eraser'].some(
    e => e === painter.getTool
  )

  if (!isTheseTool) {
    setBrush(painter.strawColor(e), 'remove')
    setChecked('0%', 'remove')
    setChecked('4.5%', 'toggle', 3)
  } else {
    ACT(ID('undo'), 'add')
  }
  ACT(ID('redo'), 'remove')
  painter.toWork = false
  painter.setStack = 1
})

painter.area.addEventListener('mouseleave', function(e) {
  painter.toWork = false
})

palette.area.addEventListener('mouseup', function(e) {
  e.stopPropagation()
  let newColor = palette.catchColor(e)
  let newColorArr = palette.getColorArr(e)
  if (e.button === 0) {
    painter.setStrokeColor = newColor
    setBrush(newColor)
    setChecked('0%', 'remove')
    painter.strokeCursor(painter.getStrokeWidth, newColor)
  } else {
    painter.setFillColor = newColor
    setShape(newColor)
    setChecked('0%', 'remove', 2)
  }
  if (e.offsetY > 510 && e.offsetY < 530) {
    palette.gradientColor(newColorArr)
    palette.alphaBar(newColorArr)
  }
})

let img = `data:image/png;base64,`

painter.drawingImg(img)
